function Validation(values) {

    let error = {}
    const correo_electronico_pattern = /^[^\s@]+@[^\s@]+\.[^\s@]+$/
    const contrasenna_pattern = /^(?=.\d)(?=.[a-z])(?=.*[A-Z])[a-zA-Z0-9]{8,}$/

    if(values.name === "") {
        error.name = "Name should not be empty"    
    }
    else {
        error.name = ""
    }

    if(values.correo_electronico === "") {
        error.correo_electronico = "Name should not be empty"    
    }
    else if(!correo_electronico_pattern.test(values.correo_electronico)) {
        error.correo_electronico = "correo_electronico Didn't match"    
    }else {
        error.correo_electronico = ""
    }


    if(values.contrasenna === "") {
        error.contrasenna = "contrasenna should not be empty"
    }
    else if(!contrasenna_pattern.test(values.contrasenna)) {
        error.contrasenna = "contrasenna didn't match"   
    }else {
        error.contrasenna = ""    
    }    
    return error;
}
export default Validation;
